import React, { Component } from "react";
import { Header, Navigation } from "react-mdl";
import { Link } from "react-router-dom";
import { logout } from "../../../../actions/patients";

class PatientHeader extends Component {
  state = {};

  logoutPatient = (app) => {
    this.props.history.push("/PatientLogin");
    logout(app);
  };
  render() {
    const { app } = this.props;
    return (
      <div>
        <Header title={<a href="/PatientHome" style="color: white;">{this.props.name + "'s profile"}</a>} className="header-color">
          <Navigation>
            <Link to="/PatientHome">Homepage</Link>
            <Link to="/ChatPage/PrePatientChat"> Ask a doctor</Link>
            <Link onClick={() => this.logoutPatient(app)}> Logout</Link>
          </Navigation>
        </Header>
      </div>
    );
  }
}

export default PatientHeader;
